let groups = ["family", "friends", "work"];

const emulator = {
  getLogo: () => {
    return owl;
  },
  getProfile: () => {
    return profile;
  },
  setProfile: (data) => {
    profile = data;
  },
  getGroups: () => {
    return groups;
  },
  addGroup: (name) => {
    return groups.push(name);
  },
  delGroup: (name) => {
    groups = groups.filter((group) => group !== name);
  },
  getContact: (contactId) => {
    return contacts.find((item) => item.id === contactId);
  },
  setContact: (contact) => {
    let item = contacts.find((item) => item.id === contact.id);
    if (item) item = contact;
    else contacts.push(contact);
  },
  delContact: (id) => {
    contacts = contacts.filter((item) => item.id !== id);
  },
  listContacts: (group) => {
    return group
      ? contacts.filter((item) => item.groups.find(group) !== undefined)
      : contacts;
  },
  findContacts: (text) => {
    return contacts.filter(
      (item) =>
        item.alias.match(text) !== undefined ||
        item.firstname.match(text) !== undefined ||
        item.lastname.match(text) !== undefined ||
        item.email.match(text) !== undefined
    );
  },
  getDialogue: (contactId) => {
    let count = 0;
    return dialog.map((item) => {
      let copy = Object.assign(item);
      copy.who = count++ % 2 ? profile.id : contactId;
      return copy;
    });
  },
};

export default emulator;
